import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import { FiMenu, FiX, FiSettings } from 'react-icons/fi';

function Navbar() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [hoverSettings, setHoverSettings] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    Swal.fire({
      title: 'Are you sure you want to logout?',
      showDenyButton: true,
      confirmButtonText: 'Yes',
      denyButtonText: 'No',
      buttonsStyling: false,
      customClass: {
        popup: 'bg-white dark:bg-gray-900 text-black dark:text-white rounded-lg',
        confirmButton: 'px-4 py-2 bg-red-600 text-white rounded-md hover:bg-red-700 m-2',
        denyButton: 'px-4 py-2 bg-gray-400 text-white rounded-md hover:bg-gray-500 m-2',
      }
    }).then((result) => {
      if (result.isConfirmed) {
        navigate('/');
      }
    });
  };

  const navStyle = `
    .navbar {
      display: flex;
      justify-content: space-between;
      align-items: center;
      padding: 12px 20px;
      background: linear-gradient(to right, #f8f9fa, #e0e0e0);
      box-shadow: 0 2px 5px rgba(0,0,0,0.1);
      position: relative;
      z-index: 20;
    }

    .nav-logo {
      font-size: 1.5rem;
      font-weight: bold;
    }

    .nav-links {
      display: flex;
      align-items: center;
      gap: 20px;
    }

    .nav-link {
      text-decoration: none;
      color: #333;
      font-weight: 500;
    }

    .auth-btn {
      padding: 6px 14px;
      font-size: 0.85rem;
      border: 2px solid #555;
      border-radius: 20px;
      margin-right: 5px;
      background: none;
      color: #333;
      cursor: pointer;
      transition: all 0.3s;
    }

    .auth-btn:hover {
      background-color: #333;
      color: #fff;
    }

    .settings-icon {
      font-size: 1.4rem;
      cursor: pointer;
      margin-left: 10px;
      position: relative;
    }

    .settings-dropdown {
      position: absolute;
      top: 45px;
      right: 20px;
      background: white;
      border: 1px solid #ccc;
      padding: 8px 0;
      border-radius: 8px;
      box-shadow: 0 2px 8px rgba(0,0,0,0.2);
      z-index: 100;
      min-width: 150px;
    }

    .settings-dropdown button {
      width: 100%;
      padding: 8px 12px;
      background: none;
      border: none;
      text-align: left;
      cursor: pointer;
      color: #333;
    }

    .settings-dropdown button:hover {
      background-color: #f1f1f1;
    }

    .mobile-menu-btn {
      display: none;
      font-size: 1.5rem;
      cursor: pointer;
    }

    @media screen and (max-width: 768px) {
      .nav-links {
        display: none;
      }

      .mobile-menu-btn {
        display: block;
      }

      .mobile-sidebar {
        position: fixed;
        top: 0;
        left: 0;
        height: 100vh;
        width: 220px;
        background-color: #f8f9fa;
        padding: 20px;
        box-shadow: 2px 0 10px rgba(0,0,0,0.1);
        z-index: 100;
      }

      .blur-overlay {
        position: fixed;
        top: 0;
        left: 0;
        height: 100vh;
        width: 100vw;
        backdrop-filter: blur(3px);
        z-index: 50;
      }

      .sidebar-links {
        display: flex;
        flex-direction: column;
        gap: 20px;
      }

      .sidebar-links a, .sidebar-links button {
        font-size: 1rem;
        font-weight: 500;
        background: none;
        border: none;
        cursor: pointer;
        color: #333;
        text-align: left;
      }

      .sidebar-links button:hover, .sidebar-links a:hover {
        color: #000;
      }
    }
  `;

  return (
    <>
      <style>{navStyle}</style>

      <div className="navbar">
        <div className="nav-logo">MyAI</div>

        <div className="nav-links">
          <Link to="/" className="nav-link">Home</Link>
          <Link to="/chat" className="nav-link">Analyze</Link>

          <Link to="/login">
            <button className="auth-btn">Log In</button>
          </Link>
          <Link to="/signup">
            <button className="auth-btn">Sign Up</button>
          </Link>

          <div
            className="settings-icon"
            onMouseEnter={() => setHoverSettings(true)}
            onMouseLeave={() => setHoverSettings(false)}
          >
            <FiSettings />
            {hoverSettings && (
              <div
                className="settings-dropdown"
                onMouseEnter={() => setHoverSettings(true)}
                onMouseLeave={() => setHoverSettings(false)}
              >
                <button onClick={handleLogout}>Logout</button>
              </div>
            )}
          </div>
        </div>

        <div className="mobile-menu-btn" onClick={() => setMenuOpen(true)}>
          <FiMenu />
        </div>
      </div>

      {menuOpen && (
        <>
          <div className="mobile-sidebar">
            <div style={{ display: 'flex', justifyContent: 'space-between' }}>
              <div style={{ fontWeight: 'bold', fontSize: '1.3rem' }}>Menu</div>
              <FiX style={{ fontSize: '1.5rem', cursor: 'pointer' }} onClick={() => setMenuOpen(false)} />
            </div>
            <div className="sidebar-links" style={{ marginTop: '30px' }}>
              <Link to="/" onClick={() => setMenuOpen(false)}>Home</Link>
              <Link to="/chat" onClick={() => setMenuOpen(false)}>Analyze</Link>
              <Link to="/login" onClick={() => setMenuOpen(false)}>Log In</Link>
              <Link to="/signup" onClick={() => setMenuOpen(false)}>Sign Up</Link>
              <button onClick={() => { setMenuOpen(false); handleLogout(); }}>Logout</button>
            </div>
          </div>
          <div className="blur-overlay" onClick={() => setMenuOpen(false)} />
        </>
      )}
    </>
  );
}

export default Navbar;
